import React, {Component} from 'react';
import { makeStyles } from '@material-ui/styles';
import {Button, Grid, Typography, Hidden, Container, Card } from '@material-ui/core';
import windowSize from 'react-window-size';
import {
  Budget,
  TotalUsers,
  TasksProgress,
  TotalProfit,
  LatestSales,
  UsersByDevice,
  LatestProducts,
  LatestOrders,
  Filter,
  PropertyList,
  MapContainer,
  PropertyHeader,
  Amenities,
  FloorPlans, 
  PropertyTitle,
  SideSticky
} from '../Apply/components';
import Location from '../Apply/components/Location/Location';

makeStyles(theme => ({
  root: {
    padding: theme.spacing(0), maxWidth: 800, 
  }
}));

const isDesktop = 0;
class Apply extends Component {
  render(){
    console.log('props: ', this.props)
    if(isDesktop == 0){
      return (
        <div>
            <PropertyTitle/>
        </div>

      );
    } else {
        return(
            <div></div>
        );
    }
  };
  }

export default windowSize(Apply);
